-- Estrutura da tabela 'products'

DROP TABLE IF EXISTS `products`;
CREATE TABLE `products` (
  `id` int DEFAULT NULL,
  `shopee_id` varchar(255) DEFAULT NULL,
  `name` varchar(255) DEFAULT NULL,
  `price` float DEFAULT NULL,
  `original_price` float DEFAULT NULL,
  `category_id` int DEFAULT NULL,
  `shop_id` int DEFAULT NULL,
  `stock` int DEFAULT NULL,
  `commission_rate` float DEFAULT NULL,
  `sales` int DEFAULT NULL,
  `image_url` varchar(255) DEFAULT NULL,
  `shop_name` varchar(255) DEFAULT NULL,
  `offer_link` varchar(255) DEFAULT NULL,
  `short_link` varchar(255) DEFAULT NULL,
  `rating_star` float DEFAULT NULL,
  `price_discount_rate` float DEFAULT NULL,
  `sub_ids` varchar(255) DEFAULT NULL,
  `created_at` datetime DEFAULT NULL,
  `updated_at` datetime DEFAULT NULL,
  `product_link` text,
  `period_start_time` datetime DEFAULT NULL,
  `period_end_time` datetime DEFAULT NULL,
  `shop_type` varchar(255) DEFAULT NULL,
  `seller_commission_rate` float DEFAULT NULL,
  `shopee_commission_rate` float DEFAULT NULL,
  `affiliate_link` varchar(255) DEFAULT NULL,
  `product_metadata` text,
  `item_status` varchar(255) DEFAULT NULL,
  `discount` varchar(255) DEFAULT NULL,
  `category_name` varchar(255) DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

